import React, { Fragment, useState } from "react";

const Register = () => {
  return (
    <Fragment>
      <h1>Register</h1>
      <form>
        <input
          type="email"
          name="email"
          placeholder="email"
          className="form-control my-3"
        />
        <input type="password" name="password" placeholder="password" />
        <input type="text" name="name" placeholder="name" />
      </form>
    </Fragment>
  );
};

export default Register;
